import React from "react";
import image1 from '../Img/Img3.jpg'
import NavigationBar from "../Components/NavigationBar";
const blogPage =()=>{
    return(
        
        <div>
            <NavigationBar />
            <h1>BlogPage</h1>
            <p>Test paragraph</p>
            <img src={image1} alt=""/>
        </div>
    )
}
export default blogPage;
